module.exports = JSON.parse('{"startButton":"Start","medienuebersichtButton":"Zur Medienbersicht","anwendungsName":"Medi-O-Mat","ersteInformation":"Ein Frage-Antwort-Tool, das dir dabei helfen soll, dein perfektes Medien-Match zu finden. Dafr brauchst du nur 5-10 Minuten Zeit, um mithilfe unseres Fragebogens deine ganz persnlichen Mediennutzungsprferenzen zu reflektieren. Auf Basis dieser Daten berechnet der Mediomat, welche der Medien aus unserem Pool am besten zu dir passen knnten.","wasIstWahlOMatHeader":"Was ist Medi-O-Mat","wasIstWahlOMatSubtext":"Schon mal von News Overload im digitalen Zeitalter gehrt?! Von stndig sinkenden Zeitungsauflagen und schlieenden Lokalredaktionen? Von alten weien Mnnern und prekren Arbeitsbedingungen im Journalismus? Von Nachdenkseiten, und da wei man ja gar nicht, was man noch glauben kann? \\n\\nTja - Willkommen in der viel besprochenen Medienkrise.\\n \\nEin Groteil der traditionellen Massenmedien scheint nicht mehr so richtig hinterherzukommen. Viele Angebote sind schlicht langweilig, weil wir uns weder verstanden noch reprsentiert fhlen. Abonnements sind teuer, trockene Texte nicht fr jede:n was und berforderung angesichts der Informationsflutwellen im Internet vorprogrammiert.\\n \\nDas Ergebnis: die Tendenz zu Nachrichtenvermeidung steigt, Vertrauen in Nachrichteninhalte geht zurck. Fr gesellschaftlichen Zusammenhalt und unsere Demokratie, die von interessierten und informierten Brger:innen lebt, ist das fatal.\\n \\nDabei gibt es sie  die neuen, experimentierfreudigen und demokratischen Anstze. Stimmen jenseits des Mainstreams  ohne Extremismustendenzen. Journalismus, der Lcken fllt und fr Vielfalt sorgt. Die Nischenangebote, die individuelle Bedrfnisse erfllen und uns vielleicht geben knnten, was wir suchen. Aber: wie findet man* die?","resultsHeader":"Hier kommen wir ins Spiel","resultsSubtext":"Wir, die Mediomat-Redaktion, sind Medieninformatiker:innen und Student:innen der Publizistik- & Kommunikationswissenschaften an der Freien Universitt in Berlin. Wir fragen uns also tglich, was Medien und Journalismus so fr unsere Gesellschaft bedeuten. Dabei beschftigen wir uns mit verschiedensten journalistischen Konzepten und Darstellungsformen  und mit den sozialen, demokratischen und menschlichen Anforderungen, die sie erfllen sollten.\\n \\nWir wissen aus eigener Erfahrung, dass es manchmal gar nicht so einfach ist, Medien zu finden, die diesen Ansprchen gerecht werden und gleichzeitig zu den eigenen Format-Vorlieben passen.\\n \\nDeshalb haben wir den Mediomat entwickelt. Ein Frage-Antwort-Tool, das dir dabei helfen soll, dein perfektes Medien-Match zu finden. Dafr brauchst du nur 5-10 Minuten Zeit, um mithilfe unseres Fragebogens deine ganz persnlichen Mediennutzungsprferenzen zu reflektieren. Auf Basis dieser Daten berechnet der Mediomat, welche der Medien aus unserem Pool am besten zu dir passen knnten. Wir sind uns sicher: es ist fr alle was dabei. Viel Spa!","disclaimerHeader":"Disclaimer - Medienwahl","disclaimerSubtext":"Bei der Auswahl der vorgestellten Medien strebten wir danach, eine breite Vielfalt zu bercksichtigen. Besonderes Augenmerk lag darauf, verschiedene Medienformate einzubeziehen, um sicherzustellen, dass jeder Nutzer unabhngig von seinen Vorlieben beim Nachrichtenkonsum ein passendes Medium findet. Der Medi-o-Mat wurde im Rahmen eines universitren Projekts entwickelt. Die Auswahl der Medien erfolgte durch eine Gruppe von Studierenden und ist daher in gewissem Mae homogen. Dennoch haben wir uns bemht, eine Auswahl zu treffen, bei der eine Vielzahl an Stimmen zu Wort kommt. Wir haben jedoch klare Grenzen gesetzt, insbesondere hinsichtlich populistischer Medien und solchen, von denen wir glauben, dass sie unzureichende journalistische Standards aufweisen. Zu diesen Medien zhlen beispielsweise die \\"Nachdenkseiten\\" oder \\"die Bild\\". In unserem universitren Projekt streben wir die Frderung von Medienkompetenz an, daher knnen wir eine Empfehlung dieser Medien nicht mit unseren Grundstzen vereinbaren.","gewichtungHeader":"Gewichtung der Thesen","gewichtungSubtext":"Welche Thesen sind Ihnen besonders wichtig? Markieren Sie die Thesen, um diese mit doppelter Gewichtung in die Berechnung einflieen zu lassen.","vielenDankHeader":"Vielen Dank frs mitmachen","vielenDankSubtext":"hier knnte ihre werbung stehen! Besuchen Sie uns bald wieder.","waehleEinMedium":"Das knnte ein Medium fr dich sein","repeat":"Nochmal!"}');

